    <h1>Statistics - Collected Taxes per State</h1>

    <table class=\"table\">
        <thead class=\"thead-dark\">
            <tr>
                <th scope=\"col\">Country</th>
                <th scope=\"col\">State</th>
                <th scope=\"col\">Total</th>
            </tr>
        </thead>
        <tbody>
        {% for state in states %}
            <tr>
                <td>{{ state.country_name }}</td>
                <td>{{ state.name }}</td>
                <td>{{ state.total }}</td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"3\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
{% endblock %}
